mapper.select:
select 

,

from TFSLG_TEMP
where AMEND_OTHER_SL = #{AMEND_OTHER_SL}
  and BRANCH = #{BRANCH}
  and COMP_CODE = #{COMP_CODE}
  and REQUISITION_NBR = #{REQUISITION_NBR}

mapper.delete:
delete from TFSLG_TEMP
where AMEND_OTHER_SL = #{AMEND_OTHER_SL}
  and BRANCH = #{BRANCH}
  and COMP_CODE = #{COMP_CODE}
  and REQUISITION_NBR = #{REQUISITION_NBR}
